<template>
    <div v-show="pvt_win.isShow.countdownWindow"
         :class="{countdown_container:true,countdown_col:true,countdown_col_countdownWindow:true,countdown_col_countdownWindow_size_large:attr.size==='large',countdown_col_countdownWindow_size_medium:attr.size==='medium',countdown_col_countdownWindow_size_small:attr.size==='small',countdown_col_countdownWindow_size_min:attr.size==='min',countdown_col_countdownWindow_checked:pvt_win.isChecked.countdownWindow,countdown_col_countdownWindow_disable:attr.disabled}"
         :style="pvt_win.style.countdownWindow">

        <div class="countdown_row countdown_row_row0">
            <div v-show="pvt_win.isShow.showImageDiv"
                 :class="{countdown_col:true,countdown_col_showImageDiv:true,countdown_col_showImageDiv_size_large:attr.size==='large',countdown_col_showImageDiv_size_medium:attr.size==='medium',countdown_col_showImageDiv_size_small:attr.size==='small',countdown_col_showImageDiv_size_min:attr.size==='min',countdown_col_showImageDiv_checked:pvt_win.isChecked.showImageDiv,countdown_col_showImageDiv_disable:attr.disabled}"
                 :style="pvt_win.style.showImageDiv">

                <lm1a-image
                        ref="firstImage"
                        refId="firstImage"
                        v-show="pvt_isShow.showImageDiv === 'firstImage'"
                        :paraVarPair="pvt_showImageDiv.firstImage.paraVarPair"
                        :para="pvt_showImageDiv.firstImage.para"
                        :attr="pvt_showImageDiv.firstImage.attr">
                </lm1a-image>
                <lm1a-image
                        ref="secondImage"
                        refId="secondImage"
                        v-show="pvt_isShow.showImageDiv === 'secondImage'"
                        :paraVarPair="pvt_showImageDiv.secondImage.paraVarPair"
                        :para="pvt_showImageDiv.secondImage.para"
                        :attr="pvt_showImageDiv.secondImage.attr">
                </lm1a-image>
                <lm1a-image
                        ref="thirdImage"
                        refId="thirdImage"
                        v-show="pvt_isShow.showImageDiv === 'thirdImage'"
                        :paraVarPair="pvt_showImageDiv.thirdImage.paraVarPair"
                        :para="pvt_showImageDiv.thirdImage.para"
                        :attr="pvt_showImageDiv.thirdImage.attr">
                </lm1a-image>
            </div>
        </div>

    </div>
</template>
<script>
    import libSys from '@/components/baseComponent/libSys.js';
    import libUpload from '@/components/baseComponent/libUpload.js';

    export default {
        components: {},
        inject: ['sys'],
        props: {
            refId: String,
            para: Object,
            attr: {
                type: Object,
                default: function () {
                    return {size: 'medium'};
                },
                validator: function (val) {
                    if (!val.size) val.size = 'medium';
                    return true;
                },
            },
            number: Number,
        },
        data: function () {
            return {
                pvt_subModuleMap: {
                    vessel: ['showImageDiv', 'showImageDiv', 'showImageDiv'],
                    subModule: ['firstImage', 'secondImage', 'thirdImage'],
                },
                pvt_isShow: {
                    showImageDiv: null,
                },
                pvt_win: {
                    isShow: {
                        countdownWindow: true,
                        showImageDiv: true,
                    },
                    isChecked: {
                        countdownWindow: false,
                        showImageDiv: false,
                    },
                    style: {
                        countdownWindow: null,
                        showImageDiv: null,
                    },
                },
                pvt_eventPortInput: [],

                firstVariable: null,
                secondVariable: null,
                thirdVariable: null,
            };
        },
        watch: {},
        computed: {
            pvt_showImageDiv: function () {
                return {
                    firstImage: {
                        paraVarPair: {
                            image: 'firstVariable',
                        },
                        para: {
                            image: this.firstVariable,
                        },
                        attr: {
                            fit: 'none',
                        },
                    },
                    secondImage: {
                        paraVarPair: {
                            image: 'secondVariable',
                        },
                        para: {
                            image: this.secondVariable,
                        },
                        attr: {
                            fit: 'none',
                        },
                    },
                    thirdImage: {
                        paraVarPair: {
                            image: 'thirdVariable',
                        },
                        para: {
                            image: this.thirdVariable,
                        },
                        attr: {
                            fit: 'none',
                        },
                    },
                };
            },
        },
        created: function () {
            Object.assign(this, libSys, libUpload);
        },
        mounted: function () {
            this.pvt_initSysData();
        },
        methods: {
            setPara: function (successCallBack, errorCallBack) {
                var para = {};
                para.successCallBack = successCallBack;
                para.errorCallBack = errorCallBack;
                para.nStep = 0;
                return para;
            },
            startModule: function (successCallBack, errorCallBack) {
                let $this = this;
                let para;
                let dbFlag;
                let ref = {
                    sm1: 'firstImage',
                    sm2: 'secondImage',
                    sm3: 'thirdImage',
                };
                if (successCallBack !== null) {
                    errorCallBack = $this.setPara(successCallBack, errorCallBack);
                    successCallBack = null;
                }
                para = errorCallBack;

                while (1) {
                    dbFlag = 0;
                    switch (para.nStep) {
                        case 0:
                            $this.firstVariable = ['data:image/png;base64,'];
                            $this.secondVariable = ['data:image/png;base64,'];
                            $this.thirdVariable = ['data:image/png;base64,'];
                            para.nStep = 'showSubModule';
                            ++dbFlag;
                            break;
                        case 'showSubModule':
                            $this.showSubModule([ref.sm1], true, function () {
                                para.nStep = 'forceUpdateData';
                                dbFlag += 1;
                                if (dbFlag === 2) {
                                    $this.startModule(successCallBack, errorCallBack)
                                }
                            }, para.errorCallBack);
                            break;
                        case 'forceUpdateData':
                            $this.forceUpdateData(function () {
                                para.nStep = 'startModule1';
                                if (++dbFlag === 2) {
                                    $this.startModule(successCallBack, errorCallBack)
                                }
                            });
                            break;
                        case 'startModule1':
                            $this.sm[ref.sm1].startModule(function () {
                                para.nStep = 'end';
                                dbFlag += 1;
                                if (dbFlag === 2) {
                                    $this.startModule(successCallBack, errorCallBack)
                                }
                            }, para.errorCallBack);
                            break;
                        case 'end':
                            para.successCallBack('success');
                            return;
                        default:
                            para.errorCallBack('error');
                            return;
                    }
                    dbFlag += 1;
                    if (dbFlag === 1) return;
                }
            },
            compShow: function (v1) {
                var $this = this;
                let ref = {sm1: v1};
                $this.showSubModule([v1], true, function () {
                    $this.sm[ref.sm1].startModule(function () {
                    }, function () {
                    });
                }, function () {
                });
            },
            timerSwitch: function () {
                var $this = this;
                setTimeout(function () {
                    $this.compShow('secondImage');
                }, 1000);
                setTimeout(function () {
                    $this.compShow('thirdImage');
                }, 2000);
            }
        },
    };
</script>
